// SPDX-License-Identifier: MIT

pragma solidity >=0.4.25 <0.7.0;

contract PsyBet {

    address public owner;
    bool public paused;
    uint public numPayments;
    uint public value;
    address payable user;

    struct Payment {
        uint amount;
        uint timestamp;
    }

    mapping(address => Payment) public paymentHistory;

    constructor() public {
        owner = msg.sender;
    }

    modifier onlyCreator () {
        // require(msg.sender == owner,"access denied !!!");
        _;
    }

    function chargeWallet (address payable _address) public payable {
        Payment memory _payment = Payment(msg.value, block.timestamp);
        paymentHistory[msg.sender] = _payment;
        user = _address;
        numPayments ++;
        value = msg.value;
    }

    function setPause(bool _value) public {
        require(owner == msg.sender,"you are very wrong person !!!");
        paused = _value;
    }

   function getBalanceOf () public view returns(uint) {
        return address(this).balance;
    }

    function destorySmartContract(address payable _to) public {
        require(owner == msg.sender,"'you are wrong person!!!");
        selfdestruct(_to);
    }

}
